import React from "react";
import { Switch, Route } from "react-router-dom";
import HeaderFooter from "./components/HeaderFooter";
import UserPage from "./pages/IUserPage";
import TopPage from "./pages/TopPage";
import AskPage from "./pages/AskPage";
import BestPage from "./pages/BestPage";
import JobPage from "./pages/JobPage";
import ShowPage from "./pages/ShowPage";
import "./App.css";

function App() {
	return (
		<>
			<Switch>
				<Route exact path="/" component={HeaderFooter} />
				<Route exact path="/top" component={TopPage} />
				<Route exact path="/best-stories" component={BestPage} />
				<Route exact path="/ask" component={AskPage} />
				<Route exact path="/show" component={ShowPage} />
				<Route exact path="/jobs" component={JobPage} />
				<Route exact path="/comments" component={HeaderFooter} />
				<Route exact path="/user/:userId" component={UserPage} />
			</Switch>
		</>
	);
}

export default App;
